import React from 'react'
import './header.css'

const Header = () => {
  return (
    <header> 
        <div className="container header__container"></div>
          <h5>Hello, I'm</h5>
          <h1>Thanyared Wong</h1>
          <h5 className="text_light">Computer Science: Computer Game Design at UCSC</h5>

    </header>
  )
}

export default Header
